import React from "react";
import { Formik, Form, Field, ErroMessege } from 'formik'
import * as yup from 'yup'
import Axios from 'axios'
import Logo from '../../componentes/img/logo-da-pizza.png'
import './Login.css'

function Login(){
    return(
        <>
           <div>
               <img src=<Logo/>/>
           </div>
        </>
    )
}

export default Login;
